import React, { useState } from 'react'
import SongList from './SongList'
import Cover from './Cover'
import Progress from './Progress'
import { Stats } from './Stats'


function DashBoard() {
    const [songlist,setSonglist] = useState([{title:"Blinding Lights",image:"data:image/jpeg;base64,",completion:90,total:17390000,unique:9470000},
        {title:"Shape of You",image:"data:image/jpeg;base64,",completion:87,total:7300000000,unique:247000000},
        {title:"Girls like you",image:"data:image/jpeg;base64,",completion:67,total:1200000000,unique:37000000},
        {title:"Despacito",image:"https://m.media-amazon.com/images/M/MV5BNmQ4YzYwOWMtODBkOC00YjljLTkzMGYtYjY2OGU1N2NiODE5XkEyXkFqcGdeQXVyNDUzOTQ5MjY@._V1_.jpg",completion:52,total:7200000000,unique:1200000000},
        {title:"Sugar",image:"data:image/jpeg;base64,",completion:90,total:1200000000,unique:400000000},

    
    
    ])
    
    
    const [selectsong,setSelectsong] = useState(null)

    const handleClick = (title,image,completion,total,unique) => {
        setSelectsong({
            title : title,
            image:image,
            completion:completion,
            total:total,
            unique:unique
        })
    }


  return (
    <div className='w-screen grid grid-cols-3 gap-2 mx-auto max-w-screen-xl px-1'>
        <div className='row-span-2 backdrop-blur-md bg-white/60 shadow-md'>
            <SongList handleClick={handleClick} songs={songlist} />
        </div>
        <div className='max-h-[280px]'>
            {selectsong && <Cover songimg={selectsong.image} title={selectsong.title} />}
        </div>
        <div className='backdrop-blur-lg bg-white/70'>
            {selectsong && <Progress progress={selectsong.completion} />}
        </div>
        <div className='col-span-2 max-h-[350px] w-[100%] flex justify-stretch object-fill shadow-md backdrop-blur-md bg-white/70'>
            {selectsong && <Stats total={selectsong.total} unique={selectsong.unique} />}
        </div>
    </div>
  )
}

export default DashBoard